import{c as n,u as a,o as e}from"./index.c6b4976c.js";const t=["innerHTML"];var u={__name:"Intro",setup:u=>(u,i)=>(e(),n("article",{class:"markdown-body",innerHTML:a('<h1>介绍</h1>\n<p>gulu-duck-ui 是一款基于 Vue 3的 UI 组件库。\n这款组件库其实是我为了总结自己这段时间学习的vue3相关的学习感受而写的，全程亲手编写，没有采用任何第三方组件库，包括你现在看到的这个官网也都是我自己写的。</p>\n<p>所以强烈不建议你将此 UI 库用于生产环境。但如果你是抱着看源代码的目的来的，那么这个库还是值得一看的。源代码放在了github和gitee上，历史提交信息非常规范，你可以按提交的顺序逐个查看；你也可以直接查看每个组件的源代码和示例，运行方法见 README.md。</p>\n<p>下一节：<a href="#/doc/installation">安装</a></p>\n')},null,8,t))};export{u as default};
